	(1,2,1432489135,'Welcome to the official Contao Demo Site','','Welcome to the official Contao Demo Site Welcome to the official Contao Demo Site Navigation A powerful CMS Manage your contents the easy/simple way. Contao enables you to create awesome interactive elements like the slider you see here with ease. This slider is based on swipe.js and comes out of the box with/including support for mobile devices. Highly Extendible Contao ist highly extendible with a lot of extensions build by the great Contao Community. Go and check out the Contao Extension Repository to see more than 1500 Extensions. Flexible Templating The modification of templates is very simple and straight forward. Nearly every template can be modified and with Contao 3.3 it is also possible to create as many extra templates for each element as you like. Take a look at the case studies to see the variety. Previous Next About this demo Welcome to the official demo website of the open source content managment system Contao. On its pages you will find demonstrations and examples of some of the features this CMS has to offer. The official Contao demo comes with every installation of the CMS and is designed to help you get started with your first web projects. Like any other content management system Contao is divided into two areas: the back end (administration area) and the front end (website). If you are reading this you are currently viewing the front end. To log in to the back end, simply add /contao to the URL of the site (http://metamodels-beginner.dev/contao). This demo contains a scenario demonstrating the different users - admins and editors - and their specific roles and rights within the CMS. Contao covers a lot of different scenarios: from a simple website managed by a single administrator to a community website with a lot of members participating as front end users. Complex company websites as intranet or internet solutions with a lot of back end users can be realized as well. The scenario includes three back end users (employees) and two front end users (students). Each of those users has been assigned a different role. You are able log in to their accounts and see how Contao looks like from their perspective. Please note that employees with the back end user role can only log in to the back end and students as front end users can only log in to the front end. Learn more On the following pages you will get a brief introduction into the basics of Contao. Of course we can not explain all the possibilities Contao offers but you will get the essential information and a first glimpse of what this CMS can do. Check out more about Roles & Permissions. What about some basics on Navigation. Also a straight forward Calendar is on board. There is a lot more to discover in this demo. Make sure you also visit http://www.contao.org for more information. Back end Login If you like to see the administration panel of contao, please choose a back end user below to log into the panel. 1. Kevin Jones - Administrator Username: k.jones Password: kevinjones Role: back end user and administrator Go to back end login 2. Helen Lewis Username: h.lewis Password: helenlewis Role: back end user Go to back end login 3. James Wilson Username: j.wilson Password: jameswilson Role: back end user Go to back end login Front end Login Please choose a front end use below to login as a front end member. This feature demonstrates the posibility to create a member area for your website. 1. John Smith Username: j.smith Password: johnsmith Role: front end user 2. Donna Evans Username: d.evans Password: donnaevans Role: front end user License The license for the official Contao demo is CC-BY-SA-4.0. Please read and respect the terms of use! The Contao demo is a community driven project. Got some ideas? Found some bugs? Visit the GitHub page and share them with us! Best regards the Contao official demo theme team. rss, RSS Feed, Contao Demo, Big Slider C, , Contao Case Studys, Visit contao.org',18.84,'99171335db7bfdca4dd3c0a8ada1a677','',X'30','en'),
	(2,48,1432570786,'Content Elements','content-elements','Content Elements Navigation Content elements Content elements are an easy and intuitive way to create content. Instead of just using a Rich Text Editor, Contao provides a separate element for each type of content like texts, lists, tables, hyperlinks, images or downloads. Here is an overview of the Contao core content elements: Text elements Name CSS class Description Headline ce_headline Generates a headline (h1 - h6). Text ce_text Generates a rich text that can be formatted using TinyMCE. HTML - Allows you to add custom HTML code. List ce_list Generates an ordered or unordered list. Table ce_table Generates an optionally sortable table. Code ce_code Highlights code snippets and prints them to the screen. Accordion elements Name CSS class Description Accordion (single element) ce_accordion Generates a single accordion element (with MooTools or jQuery). Accordion (wrapper start) ce_accordionStart Generates the opening part of the accordion wrapper. Accordion (wrapper stop) - Generates the closing part of the accordion wrapper. Content slider Name CSS class Description Content slider (wrapper start) ce_sliderStart Generates the opening part of the slider wrapper. Content slider (wrapper stop) - Generates the closing part of the slider wrapper. Link elements Name CSS class Description Hyperlink ce_hyperlink Generates a link to another website. Top link ce_toplink Generates a link to jump to the top of the page. Media elements Name CSS class Description Image ce_image Generates a stand-alone image. Gallery ce_gallery Generates a lightbox image gallery. Video/audio ce_player Generates an HTML5 video or audio player. Youtube ce_youtube Adds a YouTube video. Download elements Name CSS class Description Download ce_download Generates a link to download a file. Downloads ce_downloads Generates multiple links to download files. Include elements Name CSS class Description Article - Includes another article. Content element (parent class) Includes another content element. Form ce_form Includes a form. Module (parent class) Includes a front end module. Article teaser ce_teaser Displays the teaser text of an article. Comments ce_comments Adds a comment form to the page. There are no items matching your search. License The license for the official Contao demo is CC-BY-SA-4.0. Please read and respect the terms of use! The Contao demo is a community driven project. Got some ideas? Found some bugs? Visit the GitHub page and share them with us! Best regards the Contao official demo theme team. rss, RSS Feed, Contao Demo, About the headline element, About the text element, About the html element, About list element, About the table element, About the code element, About the accordeon element, About the content slider, About the hyperlink element, About the top link element, About the image elements, About the gallery element, About the HTML5 video and audio element, About the Youtube element, About the download element, About the downloads element, About the article include element, About the content element include element, About the form include element, About the module include element, About the article teaser include element, About the comments include element',28.38,'b8a93b0cb141297a4a7210f2d74bac17','',X'30','en'),
	(3,52,1432570157,'Accordion','accordion','Accordion Navigation Accordion The accordion element allows you to place content inside a closed panel. By clicking the headline of the panel, it will expand and close any other expanded panels. You can add an unlimited number of accordion elements on a page. Contao offers two types of accordion elements: Accordion single element This panel is build with only one element. You enter the section headline that is used as the expanding link. The content of the section is entered in a richt text field similar to text field in text elements. You even have the possibility to add an image to the content. Accordion wrapper start & end The second type of accordion is the combination of a wrapper start and stop element. All elements added between start and stop build the content of the accordion panel. Javascript Accordion To use this type of accordion element on your page, you have to enable either jQuery or Mootools and add the j_accordion or moo_accordion template to your page layout. Controlling Jennifer Connors jennifer.connors@example.com Details Geschäftsführung John Smith john.smoth@example.com Details Support Bob Anderson bob.anderson@example.com Details License The license for the official Contao demo is CC-BY-SA-4.0. Please read and respect the terms of use! The Contao demo is a community driven project. Got some ideas? Found some bugs? Visit the GitHub page and share them with us! Best regards the Contao official demo theme team. rss, RSS Feed, Contao Demo,',17.97,'b3c8f01d0ae87d1a08a167d6acc5c952','',X'30','en'),
	(4,53,1432490156,'Content slider','content-slider','Content slider Navigation Content slider The content slider does exactly, what its name says. Similar to the accordion the slider needs a wrapper start and stop. All elements placed between these wrapper elements represent the slided content. The wrapper start element offers you some parameters to modify the slider: Sliding interval: the time in milliseconds a slide is displayed until it is replaced by the next one (1000 = 1s) Transition speed: the speed of the transition from slide to slide in milliseconds (1000 = 1s) Slide offset: setting a specific slide as the starting point, the counting starts at 0 Continous: Make the slider start all over when reaching the end You can see the slider in action on the homepage. To use it, jQuery or Mootools need to be enabled in the page layout and the corresponding j- or moo-template has to be added as well. A powerful CMS Manage your contents the easy/simple way. Contao enables you to create awesome interactive elements like the slider you see here with ease. This slider is based on swipe.js and comes out of the box with/including support for mobile devices. Highly Extendible Contao ist highly extendible with a lot of extensions build by the great Contao Community. Go and check out the Contao Extension Repository to see more than 1500 Extensions. Flexible Templating The modification of templates is very simple and straight forward. Nearly every template can be modified and with Contao 3.3 it is also possible to create as many extra templates for each element as you like. Take a look at the case studies to see the variety. Previous Next License The license for the official Contao demo is CC-BY-SA-4.0. Please read and respect the terms of use! The Contao demo is a community driven project. Got some ideas? Found some bugs? Visit the GitHub page and share them with us! Best regards the Contao official demo theme team. rss, RSS Feed, Contao Demo, Accordion, Welcome to the official Contao Demo Site, Big Slider C, , Contao Case Studys',17.19,'6e29939c810de270b5cd737f5c83de5a','',X'30','en'),
	(5,49,1432490160,'Modules','modules','Modules Navigation Modules In this section we would like to introduce the different modules delivered with every Contao installation. Modules in Contao help you to achieve certain functions and possibilities for your users to interact with your website. You can either create different ways of displaying page navigations, create a search module, import RSS-feeds or integrate a user registration. Modules are defined in the front end modules section of the back end under Layout > Themes Navigation Module CSS class Description Navigation menu mod_navigation Generates a navigation menu from the site structure. Custom navigation mod_customnav Generates a custom navigation menu. Breadcrumb navigation mod_breadcrumb Generates a breadcrumb navigation menu. Quick navigation mod_quicknav Generates a drop-down menu from the site structure. Quick link mod_quicklink Generates a custom drop-down menu. Book navigation mod_booknav Generates a book navigation menu. Article navigation mod_article_nav Generates a pagination menu to navigate articles. Sitemap mod_sitemap Generates a list of all pages in the site structure. User Module CSS class Description Login form mod_login Generates a login form. Automatic logout - Automatically logs out a user. Personal data mod_personalData Generates a form to edit a user\'s personal data. Registration mod_registration Generates a user registration form. Lost password mod_password Generates a form to request a new password. Close account mod_closeAccount Generates a form to delete a member account. News Module CSS class Description Newslist mod_newslist Adds a list of news items to the page. Newsreader mod_newsreader Shows the details of a news item. News archive mod_newsarchive Adds a news archive to the page. News archive menu mod_newsmenu Generates a navigation menu to browse the news archive. Events Module CSS class Description Calendar mod_calendar Adds a calendar to the page. Event reader mod_eventreader Shows the details of an event. Event list mod_eventlist Adds a list of events to the page. Event list menu mod_eventmenu Generates a navigation menu to browse the event list. Newsletter Module CSS class Description Subscribe mod_subscribe Generates a form to subscribe to one or more newsletter. Unsubscribe mod_unsubscribe Generates a form to unsubscribe from one or more newsletters. Newsletter list mod_nl_list Adds a list of newsletters to the page. Newsletter reader mod_nl_reader Shows the details of a newsletter. FAQ Module CSS class Description FAQ list mod_faqlist Adds a list of frequently asked questions to the page. FAQ reader mod_faqreader Shows the answer to a frequently asked question. FAQ page mod_faqpage Shows the FAQ list and FAQ reader on the same page. License The license for the official Contao demo is CC-BY-SA-4.0. Please read and respect the terms of use! The Contao demo is a community driven project. Got some ideas? Found some bugs? Visit the GitHub page and share them with us! Best regards the Contao official demo theme team. rss, RSS Feed, Contao Demo',27.21,'d88f034ac0a60ab2d354f3d2cd63ccab','',X'30','en'),
	(6,55,1432573782,'Media elements','media-elements','Media elements Navigation Media elements Images, videos and other media are one of the most powerful contents available for a website. Images are faster to assess and have a stronger impact on the visitor compared to a simple text block. Therefore Contao allows you to integrate different kinds of media easily. When creating a media element, e.g. for an image, in the back end, you are able to: select a media source where the image is uploaded from a substitute text, which is shown, if the image can not be displayed the height and width of the image, the distance of the image to the surrounding text the destination website, if the image acts as a link a subline for the image the option to show the image in full resolution, when the visitor clicks on the image Some media can also be grouped in a gallery. Gallery example with thumbnails and full-size view Youtube video example Jennifer Connors Controlling jennifer.connors@example.com Details License The license for the official Contao demo is CC-BY-SA-4.0. Please read and respect the terms of use! The Contao demo is a community driven project. Got some ideas? Found some bugs? Visit the GitHub page and share them with us! Best regards the Contao official demo theme team. rss, RSS Feed, Contao Demo, DSC_5276.jpg, DSC_5316.jpg, DSC_5403.jpg,',17.96,'782fa8fc82b701d5962487eb45dd5fa9','',X'30','en'),
	(7,71,1432576109,'MetaModels','metamodels','MetaModels Navigation Jennifer Connors Controlling jennifer.connors@example.com Details Peter Lustig Superhelden peter@lustig.de Details John Smith Geschäftsführung john.smoth@example.com Details License The license for the official Contao demo is CC-BY-SA-4.0. Please read and respect the terms of use! The Contao demo is a community driven project. Got some ideas? Found some bugs? Visit the GitHub page and share them with us! Best regards the Contao official demo theme team. rss, RSS Feed, Contao Demo,',14.5,'56a8867b99d2fd9aa48fb3cda13d266d','',X'30','en'),
	(10,56,1432575731,'File elements','file-elements','File elements Navigation File elements File elements create the possibility to make files available for download on your website. The element „Download“ allows you to make a single file downloadable. The element „Downloads“ has the same functions with the addition, that you can choose several files at once. Before using the file element itself, you should upload all the files you want to provide on your website in the Contao file manager. After accomplishing that you can create the file element. The element allowes you to: set the „source file“ by selecting the desired file in the file manager enter a word or phase which replaces the file name as the name of the download Single Download file example contao_fanpage_logo.pdf (47.0 KiB) Download List Example DSC_5276.jpg (41.0 KiB) DSC_5316.jpg (29.8 KiB) DSC_5403.jpg (35.6 KiB) contao_fanpage_logo.pdf (47.0 KiB) Peter Lustig Superhelden peter@lustig.de Details License The license for the official Contao demo is CC-BY-SA-4.0. Please read and respect the terms of use! The Contao demo is a community driven project. Got some ideas? Found some bugs? Visit the GitHub page and share them with us! Best regards the Contao official demo theme team. rss, RSS Feed, Contao Demo, , contao_fanpage_logo.pdf, DSC_5276.jpg, DSC_5316.jpg, DSC_5403.jpg',17.28,'eff512bae5b1d1755f72bc085d8f6321','',X'30','en'),
	(8,72,1432574386,'Connors','metamodels/metamodels-detail/jennifer-connors','Connors Navigation Foto: Abteilung: Controlling Vorname: Jennifer Name: Connors E-Mail: jennifer.connors@example.com Telefon: 303-555-3434 Adresse: 3100 Marine Street Office 505 548 UCB Boulder, CO 80309-0584 License The license for the official Contao demo is CC-BY-SA-4.0. Please read and respect the terms of use! The Contao demo is a community driven project. Got some ideas? Found some bugs? Visit the GitHub page and share them with us! Best regards the Contao official demo theme team. rss, RSS Feed, Contao Demo,',12.73,'7c5ebf21eb6f8ac90f6c1878f0859d66','',X'30','en'),
	(9,51,1432573651,'Text elements','text-elements','Text elements Navigation Text elements You use text elements to include different types of text content on your page. Contao offers special elements that are optimized for management in the back-end and deliver correct output in the front end. In the following paragraphs the characteristics of the individual element types are described and explained. Headline The headline element adds a single headline to your page. You can set the level of the headline ranging from h1 to h6. The first headline on this page was created by using a headline element with the level set to h1. But you do not have to use this element to add a headline to your page. Almost every other element features an additional input field to add a headline also offering the levels h1 to h6. Text Adding an image to a text element The text element provides a rich text editor in the back-end allowing you to format the text output in the same way as popular office software. You can set words or phrases in bold or italic or add underlining and integrate (hyper) links to other pages of the same website, links to files or file downloads or external URLs to name just a few features of the utilized tinyMCE editor. The element also allows to add a single image which can be positioned relatively to the text. The image can be placed above or below the text or placed floating left or right of the text. You are able to choose from several options to modify the picture, e.g. resizing or even cropping it and to add a link to a contao page, to an external URI or to a full resolution version of the image. You can define wether the linked page will be opened in a new window or tab of your browser. The full resolution version of the image will be opened in an overlay on the same page if defined that way in the page layout. HTML The HTML element can be used to enter pure HTML code. The allowed tags have to be defined in the contao settings in the security section. Most of the HTML tags are allowed by default. Some tags with security relevance such as \'script\' have to be added manually if needed. Definition list Example Buil with the Contao Content Element HTML. You can use many more HTML Tags if you like. List To add ordered or unordered lists as a single element - not within the text element - contao provides the list element. With a special back-end widget you can add each list entry via a single input field, sort the entries, insert new entries or copy them. Ordered list Example Ordered List Example 1 Ordered List Example 2 Ordered List Example 3 Ordered List Example 4 Unordered list Example Unordered List Example 1 Unordered List Example 2 Unordered List Example 3 Unordered List Example 4 Table To create a table you can use the table element. Contao offers a special back-end widget, similar to the one utilized for lists, to add columns and rows, define a head- and footer-row and add a summary for the table content. In the front-end output, special classes can be chosen and added to the table, rows and cells. Just check the HTML code of the page content elements, to explore the possible classes. In addition, you can add a sorting option for the frontend to make the table sortable by all columns. Example Head 1 Head 2 Head 3 Column 1 Column 2 Column 3 Column 1 Column 2 Column 3 Column 1 Column 2 Column 3 Code To provide a snippet of programming code like i.e. Php or JavaScript, you use the code element. The code will not be executed in the front-end of the page. <script> alert(\'Hello World!!\'); </script> License The license for the official Contao demo is CC-BY-SA-4.0. Please read and respect the terms of use! The Contao demo is a community driven project. Got some ideas? Found some bugs? Visit the GitHub page and share them with us! Best regards the Contao official demo theme team. rss, RSS Feed, Contao Demo, Adding an image to a text element, Content Elements',20.65,'a1baa7e85a729dfce8cdcc1fa6b4ae92','',X'30','en'),
	(11,72,1432575741,'MetaModels Detail','metamodels/metamodels-detail/peter-lustig','MetaModels Detail Navigation Abteilung: Superhelden Name: Peter Lustig E-Mail: peter@lustig.de License The license for the official Contao demo is CC-BY-SA-4.0. Please read and respect the terms of use! The Contao demo is a community driven project. Got some ideas? Found some bugs? Visit the GitHub page and share them with us! Best regards the Contao official demo theme team. rss, RSS Feed, Contao Demo',11.88,'dc4204e07e0717fde9c0c387a330219e','',X'30','en');
